import {
  BrowserRouter as Router,
  Switch,
  Route,
  Redirect,
} from 'react-router-dom';
import Welcome from './Pages/Welcome';
import Products from './Pages/Products'
import MainHeader from './Components/MainHeader';

function App() {
  return (

      <Router>

      <MainHeader isAuth={false}/>
      <Switch>
        <Route path="/welcome">
          <Welcome/>
        </Route>
        <Route path="/products">
          <Products/>
        </Route>
      </Switch>


    </Router>
  );
}

export default App;
